import Header from './components/Header';
import Nav from './components/Nav';
import Items from './components/Items';

import './Cart.css';

const Cart = () =>{
    return (
        <div className="cart">
            <Header/>
            <Nav/>
            <Items/>
        </div>
    );
};

export default Cart;
